import React from "react";

const Education = () => {
  return (
    <>
      <h1 className="resume">
        "If there is something that describes me, it is the
        <strong>adrenaline</strong> to start something new, the
        <strong> commitment</strong> to continue it and the
        <strong>resilience</strong> to continue despite unfavorable situations.
        With experience in the management of human capital in multinational
        companies, redirected to Front-end development, interface design and
        user experience, restless and in the constant search for new ideas,
        business orientation, with strategic, creative thinking, resilient and
        committed"
      </h1>
    </>
  );
};

export default Education;
